import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
    <>
        const myprograms = ['Java', 'Spring', 'Hibernate', 'C', 'C++'];
        console.log(myprograms);
    </>,
    document.getElementById('root')
);
